import React from 'react'
import Input from './Input';

function FormControl(props) {
    const {control,...rest}=props;
    switch (control) {
        case "input":
            return <Input {...rest}/>
            break;
    
        default:
            return null;
            break;
    }
    
}

export default FormControl
